import React from 'react'
import {List, Avatar, ListItemAvatar, ListItem, ListItemText} from '@material-ui/core'
function Todo(props){
	return (
		<List>
		<ListItem>
		<ListItemAvatar>
		</ListItemAvatar>
		<ListItemText primary="Todo..." secondary={props.text} />
		</ListItem>
		</List>
	)
};
export default Todo
